import MainClick from "./MainScooter";

function Boss(handleClicks, bossCount, HP, defense, number) {
    return ( 
        <div className="main_click">
            <MainClick handleClick = {() => handleClicks} number = {number} bossCount = {bossCount} />
            <span className="main_count red" id="count">HP: {HP} Защита: {defense}</span>
      </div>
     );
}

export default Boss;
